import { repeaterData, RepeaterControl } from './gutenberg-repeater-control/index.js';

const { __ } = wp.i18n;
const { registerBlockType } = wp.blocks;
const { RichText, InspectorControls } = wp.blockEditor;
const {
  PanelBody,
  PanelRow,
  TextControl,
  TextareaControl
} = wp.components;

registerBlockType("gb/centeredaccordion", {
  title: __("Centered Accordion", "GB"),
  icon: (
    <img src="data:image/png;base64," />
  ),
  category: "faq",
  attributes: {
    hidden: {
      type: "string|array", // It's a string when persisted but when working on gutenberg it's an array
      source: "attribute",
      selector: "select",
      attribute: "hidden",
      default: [],
    },
    contentUA: { type: "string", default: `Frequently asked questions` },
    contentt: {
      type: "string",
      default: ` What&#039;s the best thing about Switzerland? `,
    },
    contentUB: {
      type: "string",
      default: `I don&#039;t know, but the flag is a big plus. Lorem ipsum dolor sit amet consectetur adipisicing elit. Quas cupiditate laboriosam fugiat.`,
    },
  },
  edit: function (props) {
    const { attributes, setAttributes } = props;
    const arData = repeaterData(props.attributes.hidden, true);


    return (
      <div className="bg-gray-50">
        
        <InspectorControls>
          <PanelBody title="Block settings">
            <PanelRow>
              <b>FAQ's</b>
            </PanelRow>
            <PanelRow>
              <RepeaterControl
                max={10}
                value={props.attributes.hidden}
                onChange={(val) => {
                  props.setAttributes({ hidden: val });
                }}
              >
                {(value, onChange) => {
                  return [
                    <TextControl
                      label="Question"
                      value={value.question}
                      onChange={(v) => {
                        value.question = v;
                        onChange(value);
                      }}
                    />,
                    <TextareaControl
                      label="Answer"
                      value={value.answer}
                      onChange={(v) => {
                        value.answer = v;
                        onChange(value);
                      }}
                    />,
                  ];
                }}
              </RepeaterControl>
            </PanelRow>
          </PanelBody>
        </InspectorControls>


        <div className="max-w-7xl mx-auto py-12 px-4 sm:py-16 sm:px-6 lg:px-8">
          
          <div className="max-w-3xl mx-auto divide-y-2 divide-gray-200">
            
            <h2 className="text-center text-3xl font-extrabold text-gray-900 sm:text-4xl">
              <RichText
                value={attributes.contentUA}
                default={"Frequently asked questions"}
                onChange={(newtext) => setAttributes({ contentUA: newtext })}
              />
            </h2>
            <dl className="mt-6 space-y-6 divide-y divide-gray-200">
                {arData.map((v) => {
                  return (
<div className="pt-6">
                
                <dt className="text-lg">
                  
                  <button
                    type="button"
                    className="text-left w-full flex justify-between items-start text-gray-400"
                    aria-controls="faq-0"
                    aria-expanded="false"
                  >
                    
                    <span className="font-medium text-gray-900">
                      {v.question}
                    </span>
                    <span className="ml-6 h-7 flex items-center">
                      
                      <svg
                        className="rotate-0 h-6 w-6 transform"
                        xmlns="http://www.w3.org/2000/svg"
                        fill="none"
                        viewBox="0 0 24 24"
                        stroke="currentColor"
                        aria-hidden="true"
                      >
                        
                        <path
                          stroke-linecap="round"
                          stroke-linejoin="round"
                          stroke-width="2"
                          d="M19 9l-7 7-7-7"
                        />
                      </svg>
                    </span>
                  </button>
                </dt>
                <dd className="mt-2 pr-12" id="faq-0">
                  
                  <p className="text-base text-gray-500">
                    {v.answer}
                  </p>
                </dd>
              </div>

                  )
                })}

            </dl>
          </div>
        </div>
      </div>
    );
  },
  save: function (props) {
    const { attributes } = props;
    const arData = repeaterData(props.attributes.hidden, true);


    return (
      <div class="bg-gray-50">
        
        <div class="max-w-7xl mx-auto py-12 px-4 sm:py-16 sm:px-6 lg:px-8">
          
          <div class="max-w-3xl mx-auto divide-y-2 divide-gray-200">
            
            <h2 class="text-center text-3xl font-extrabold text-gray-900 sm:text-4xl">
             <RichText.Content value={attributes.contentUA}/>
            </h2>
            <dl class="mt-6 space-y-6 divide-y divide-gray-200">
              
              
                {arData.map((v) => {
                  return (
<div className="pt-6">
                
                <dt className="text-lg">
                  
                  <button
                    type="button"
                    className="text-left w-full flex justify-between items-start text-gray-400"
                    aria-controls="faq-0"
                    aria-expanded="false"
                  >
                    
                    <span className="font-medium text-gray-900">
                      {v.question}
                    </span>
                    <span className="ml-6 h-7 flex items-center">
                      
                      <svg
                        className="rotate-0 h-6 w-6 transform"
                        xmlns="http://www.w3.org/2000/svg"
                        fill="none"
                        viewBox="0 0 24 24"
                        stroke="currentColor"
                        aria-hidden="true"
                      >
                        
                        <path
                          stroke-linecap="round"
                          stroke-linejoin="round"
                          stroke-width="2"
                          d="M19 9l-7 7-7-7"
                        />
                      </svg>
                    </span>
                  </button>
                </dt>
                <dd className="mt-2 pr-12" id="faq-0">
                  
                  <p className="text-base text-gray-500">
                    {v.answer}
                  </p>
                </dd>
              </div>

                  )
                })}

            </dl>
          </div>
        </div>
      </div>
    );
  },
});
